import React from "react";
import SkillBar from "../components/SkillBar"
import Header from "../components/Header";
import "./Skills.css"

export default function Connect() {
    return (
        <div className="skills" id="skills">
            <Header title={"Skills"} caption={"These are some of the skills that I've picked up over the years.  Each skill is rated 0-100 with 0 meaning I'm a beginner and 100 meaning advanced profieciency."} />
            <div className="row skills-row">
                <div className="col-6">
                    <SkillBar />
                </div>
                <div className="col-6">
                    <SkillBar />
                </div>
            </div>
        </div>
    )
}
